import styled from "styled-components";
function Header() {
    const HeaderContainer = styled.div`
        background : black;
        color   :   white;
        padding :   24px 24px;
        display :   flex;
        flex-direction  :   row;
    `;

    const HeaderSubContainer = styled.div`
        color   :   white;
        padding :   8px;
        display :   flex;
        flex-direction  :   row;
        font-weight : 600;
    `;

    const SearchBar = styled.div`
        background  : grey;

    `;

    return (
    <div>
    <HeaderContainer>
        <HeaderSubContainer>PLAN R</HeaderSubContainer>
        <HeaderSubContainer>PLAN R</HeaderSubContainer>
        <HeaderSubContainer>PLAN R</HeaderSubContainer>
    </HeaderContainer>
    </div>
  );
}

export default Header;
